import Button from "./Button"

const NavBar = () => {
    return (
        <div className='navbar'>
            <Button id="aboutBtn" text='About'/>
            <Button id="expBtn" text='Experience'/>
            <Button id="contactBtn" text='Contact'/>
        </div>
    )
}

export default NavBar
